import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import App from './App';

const AppR = () => {
  return (
    <Router>
    <Routes>
        <Route path="/" component={App} />
    </Routes>
    </Router>
  );
};

export default AppR;
